    columns: JSX.Element[]
    getRow: (info: Index) => any
}

const Table: React.FC<IProps> = (props) =>{
    const {columns, getRow} = props

    return(
        <VirtualizedTable rowGetter={getRow} noRowsRenderer={() => (<div></div>)} {...props}>
           {/* {columns.map((col) =>{
